import React, { Component } from 'react'
import data from '../MyCourseWorkData'
import './MyCourseWorkDetail.css'

interface Props{

}

interface State{

}

class MyCourseWork extends Component<Props,State>{
    constructor(props : Props){
        super(props);
        this.state={}
    }

    private renderContentBar(){
        return(
            <div className='informationWindow'>
                <p className='descriptionDetail'>{data.description}</p>
                <div className='attached'>
                    <p>Прикрепленные файлы: {data.file}</p>
                    <p>Прикрепленные ссылки: {data.link}</p>
                </div>
                <div className='attach'>
                    <p className='attachTitle'>Прикрепить</p>
                    <button className='attachButtons green'>Презентацию</button>    
                    <button className='attachButtons green'>Отзыв консультанта</button>    
                    <button className='attachButtons green'>Отчет</button>  
                </div>
                <div className='delete'> 
                    <p className='attachTitle'>Удалить</p> 
                    <button className='attachButtons red'>Отчет</button>
                    <button className='attachButtons red'>Презентацию</button>
                </div>
                <div>
                    <textarea>Ссылка</textarea>
                    <button>Прикрепитб</button>
                </div>
            </div>
        )
    }

    render(){
        return this.renderContentBar();
    }
}


export default MyCourseWork
